import React from 'react';
import  { add, sub, mult, div}  from  './Cdd';

function Add(){
    return(
        <>
        <ul>
        <li>sum of two number is:{add(40,5)}</li>
        <li>sub of two number is:{sub(40,5)}</li>
        <li>mul of two number is:{mult(40,5)}</li>
        <li>div of two number is:{div(40,6)}</li>
        </ul>
        </>
    );
}

export default Add;
